 SEO meta settings of pages like search results, 404s, etc. %s.'=>'検索結果、404 などのページの SEO メタ設定をカスタマイズします。%s。','Change Global SEO, Schema, and other settings for %1$s. %2$s'=>'%1$s のグローバル SEO、スキーマ、およびその他の設定を変更します。%2$s','Easy %s'=>'簡単な %s','For websites where you only want to change the basics and let Rank Math do most of the heavy lifting. Most settings are set to default as per industry best practices. One just has to set it and forget it.'=>'基本を変更し、Rank Math に大部分の手間のかかる作業を任せたいサイトの場合。 ほとんどの設定は、業界のベストプラクティスに従ってデフォルトに設定されています。 設定して忘れるだけです。 ','Advanced %s'=>'高度な%s','Out of stock'=>'在庫切れ','read here'=>'ここを読む','Image SEO'=>'画像の SEO','Easy Mode'=>'簡単モード','Advanced Mode'=>'上級モード','If you have %s enabled, errors will be stored in a log file. Here you can find the last 100 lines in reversed order so that you or the Rank Math support team can view it easily. The file cannot be edited here.'=>'%s を有効にしている場合、エラーはログファイルに保存されます。 ここでは、最後の100行を逆の順序で見つけることができるため、Rank Math のサポートチームはそれを簡単に表示できます。 ここではファイルを編集できません。','Copy Log to Clipboard'=>'ログをクリップボードにコピー','The error log cannot be retrieved.'=>'エラーログを取得できません。','The error log cannot be retrieved: Error log file is too large.'=>'エラーログを取得できません。エラーログファイルが大きすぎます。','Automatic updates are not enabled on your site. %s'=>'サイトで自動更新が有効になっていません。%s','Choose how you want Rank Math to handle your WooCommerce SEO. %s.'=>'Rank Math で WooCommerce SEO を処理する方法を選択します。%s。','WordPress Dashboard > Settings > Permalinks > Product permalinks Example: default: /product/accessories/action-figures/acme/ - becomes: /accessories/action-figures/acme/'=>'WordPress ダッシュボード > 設定 > パーマリンク > 製品のパーマリンク。例：デフォルト：/product/accessories/action-figures/acme/ - これになります：/accessories/action-figures/acme/','Conversion started. A success message will be shown here once the process completes. You can close this page.'=>'変換を開始しました。 プロセスが完了すると、成功メッセージがここに表示されます。 このページを閉じることができます。','Monitor broken pages that ruin user-experience and affect SEO. %s.'=>'ユーザーエクスペリエンスを台無しにし、SEO に影響を与える壊れたページを監視します。%s。','Easily create redirects without fiddling with tedious code. %s.'=>'面倒なコードをいじることなく、リダイレクトを簡単に作成できます。%s。','Change Sitemap settings of %1$s. %2$s.'=>'%1$s のサイトマップ設定を変更します。%2$s。','Redirect non-existent content easily with 301 and 302 status code. This can help improve your site ranking. Also supports many other response codes.'=>'存在しないコンテンツを 301 および 302 ステータスコードで簡単にリダイレクトします。これは、サイトのランキングを向上させるのに役立ちます。他の多くの応答コードもサポートします。 ','Enable Rank Math\'s sitemap feature, which helps search engines intelligently crawl your website\'s content. It also supports hreflang tag.'=>'Rank Math のサイトマップ機能を有効にします。これは、検索エンジンがサイトのコンテンツをインテリジェントにクロールするのに役立ちます。また、hreflang タグもサポートしています。 ','Counts the total number of internal, external links, to and from links inside your posts. You can also see the same count in the Posts List Page.'=>'投稿内のリンクとの間の内部リンクと外部リンクの総数をカウントします。 投稿リストページでも同じ数を確認できます。','Rank Math generates the default Sitemaps only and WPML takes care of the rest. When a search engine bot visits any post/page, it is shown hreflang tag that helps it crawl the translated pages. This is one of the recommended methods by Google. Please %s'=>'Rank Math はデフォルトのサイトマップのみを生成し、残りは WPML が処理します。検索エンジンボットが投稿/ページにアクセスすると、翻訳されたページをクロールするのに役立つ hreflang タグが表示されます。これは、Google が推奨する方法の1つです。%s してください。 ','Advanced Image SEO options to supercharge your website. Automate the task of adding the ALT and Title tags to your images on the fly.'=>'サイトを過給するための高度な画像 SEO オプション。 ALT タグとタイトルタグをその場で画像に追加するタスクを自動化します。','The Role Manager allows you to use WordPress roles to control which of your site users can have edit or view access to Rank Math\'s settings.'=>'ロールマネージャーを使用すると、WordPress の役割を使用して、Rank Math の設定への編集または表示アクセス権を持つことができるサイトユーザーを制御できます。','Install %s to make Rank Math work with Accelerated Mobile Pages. Rank Math automatically adds required meta tags in all the AMP pages.'=>'%s をインストールして、Rank Math を Accelerated Mobile Pages で機能させます。Rank Math は、すべての AMP ページに必要なメタタグを自動的に追加します。','Optimize WooCommerce Pages for Search Engines by adding required metadata and Product Schema which will make your site stand out in the SERPs.'=>'必要なメタデータと製品スキーマを追加して、検索エンジンの WooCommerce ページを最適化します。これにより、SERP でサイトを際立たせることができます。','Change how some of the links open and operate on your website. %s.'=>'一部のリンクがサイトで開いて動作する方法を変更します。%s。','Here you can set up the breadcrumbs function. %s'=>'ここで、パンくずリスト機能を設定できます。%s','Use the following code in your theme template files to display breadcrumbs.'=>'パンくずリストを表示するには、テーマテンプレートファイルで次のコードを使用します。','Enter verification codes for third-party webmaster tools. %s'=>'サードパーティのウェブマスターツールの確認コードを入力します。%s','Change some uncommon but essential settings here. %s.'=>'ここで、いくつかの珍しいが重要な設定を変更します。%s。','Edit the contents of your .htaccess file easily. %s.'=>'.htaccessファイルの内容を簡単に編集します。%s。','Change Global meta settings that take effect across your website. %s.'=>'サイト全体で有効になるグローバルメタ設定を変更します。%s。','Optimize for local searches and Knowledge Graph using these settings. %s.'=>'これらの設定を使用して、ローカル検索とナレッジグラフ用に最適化します。 %s。','Error Log'=>'エラーログ','Edit Page: '=>'固定ページを編集:','Static page is set as the front page (WP Dashboard > Settings > Reading). To add SEO title, description, and meta for the homepage, please click here: %s'=>'静的ページがフロントページとして設定されます（「WP ダッシュボード」> 「設定」> 「読み取り」）。 ホームページのSEOタイトル、説明、メタを追加するには、ここをクリックしてください：%s','Edit your robots.txt file to control what bots see. %s.'=>'robots.txt ファイルを編集して、ボットに表示される内容を制御します。%s。','Sorry, you are not allowed to deactivate plugins for this site.'=>'このサイトのプラグインを停止する権限がありません。','You are not allowed to deactivate this plugin: %s.'=>'このプラグインを停止する権限がありません: %s。','Click here to Deactivate'=>'ここをクリックして無効化','filter'=>'フィルター','Remove prefix like %1$s from product URL chosen at %2$s'=>'%2$s で選択された製品URLから %1$s のようなプレフィックスを削除します','If you are showing the SEO scores on the front end, this option will insert a %1$s backlink to RankMath.com to show your support. You can change the link & the text by using this %2$s.'=>'フロントエンドに SEO スコアを表示している場合、このオプションは、サポートを示すために、RankMath.com への%1$sバックリンクを挿入します。この%2$sを使用して、リンクとテキストを変更できます。 ','Automatic Updates'=>'自動更新','Priority'=>'優先順位','Rank Math auto-update option is enabled on your site.'=>'Rank Math 自動更新設定はお使いのサイトで有効です。','Enable Auto Updates'=>'自動更新を有効化','Enable automatic updates to ensure you are always using the latest version of Rank Math.'=>'自動更新を有効にして、常に最新バージョンの Rank Math を使用していることを確認します。','Invalid post ID.'=>'無効な投稿 ID です。','Sorry, you are not allowed to edit this post.'=>'この投稿を編集する権限がありません。','Sorry, you are not allowed to edit this post type.'=>'この投稿タイプを編集する権限がありません。','Sorry, you are not allowed to create/update redirection.'=>'リダイレクトを作成 / 更新する権限がありません。','Ignore Case'=>'大文字小文字の区別なし','configuration file'=>'構成ファイル','Click here to see the code.'=>'ここをクリックしてコードを見る。','Online Event URL'=>'オンラインイベントの URL','Online + Offline'=>'オンライン + オフライン','Event Attendance Mode'=>'イベント出席モード','%1$s and %2$s'=>'%1$s、%2$s','Total Time:'=>'合計時間:','No post found.'=>'投稿が見つかりませんでした。','Import Blocks'=>'ブロックをインポート','Blocks import failed.'=>'ブロックのインポートに失敗しました。','%d minute'=>'%d分','%d hour'=>'%d時間','%d day'=>'%d日','%1$s, %2$s and %3$s'=>'%1$s、%2$s、%3$s','Imported blocks from posts %1$s - %2$s out of %3$s '=>'投稿からインポートされたブロック %1$s - %2$s / %3$s','Import and convert all compatible blocks in post contents.'=>'投稿コンテンツ内の互換性のあるすべてのブロックをインポートして変換します。','Your sitemap index can be found here: %s'=>'サイトマップインデックスはここにあります：%s','Unordered'=>'順序なしリスト','Yoast Block Converter'=>'Yoast のブロックコンバーター','Are you sure you want to convert Yoast blocks into Rank Math blocks? This action is irreversible.'=>'Yoast ブロックを Rank Math ブロックに変換してもよろしいですか？ このアクションは元に戻せません。 ','Convert Blocks'=>'ブロックを変換する','No posts found to convert.'=>'変換する投稿が見つかりません。','Numbered'=>'番号付き','Update Now'=>'今すぐ更新','Your Version'=>'お使いのバージョン','Warning: '=>'警告:','Import & Export'=>'インポートとエクスポート','Beta Tester'=>'ベータテスター','Database Tools'=>'データベースツール','This update will install a beta version of Rank Math.'=>'このアップデートでは、Rank Math のベータ版がインストールされます。','Rollback Plugin'=>'プラグインをロールバックする','Plugin rollback successful.'=>'プラグインのロールバックが成功しました。','Installing the rollback version&#8230;'=>'ロールバックバージョン &#8230; のインストール','Are you sure you want to install version %s?'=>'バージョン%sをインストールしてもよろしいですか？','Version Control'=>'バージョン管理','Turn on auto-updates to automatically update to stable versions of Rank Math as soon as they are released. The beta versions will never install automatically.'=>'自動更新をオンにすると、Rank Math の安定したバージョンがリリースされるとすぐに自動的に更新されます。 ベータ版が自動的にインストールされることはありません。','Auto Update Plugin'=>'自動更新プラグイン','Rank Math will not auto-update because you have rolled back to a previous version. Update to the latest version manually to make this option work again.'=>'以前のバージョンにロールバックしたため、Rank Math は自動更新されません。 このオプションを再度機能させるには、手動で最新バージョンに更新してください。','Rollback to Previous Version'=>'以前のバージョンへのロールバック','If you are facing issues after an update, you can reinstall a previous version with this tool.'=>'更新後に問題が発生した場合は、このツールを使用して以前のバージョンを再インストールできます。','%s Previous versions may not be secure or stable. Proceed with caution and always create a backup.'=>'%s 以前のバージョンは安全または安定していない可能性があります。 注意して続行し、常にバックアップを作成してください。','%s Auto updates will not work, please update the plugin manually.'=>'%s 自動更新は機能しません。プラグインを手動で更新してください。','Rolled Back Version: '=>'ロールバックバージョン：','You are using the latest version of the plugin.'=>'プラグインの最新バージョンを使用しています。','This is the version you are using on this site.'=>'これは、このサイトで使用しているバージョンです。','Latest Stable Version'=>'最新の安定バージョン','This is the latest version of the plugin.'=>'これはプラグインの最新バージョンです。','Rollback Version'=>'ロールバックバージョン','Roll back to this version.'=>'このバージョンにロールバックします。','Install Version %s'=>'バージョン %s をインストールします','Install Selected Version'=>'選択したバージョンをインストールする','Reinstalling, please wait...'=>'再インストール、お待ちください...','Beta Opt-in'=>'ベータ機能をオン','You can take part in shaping Rank Math by test-driving the newest features and letting us know what you think. Turn on the Beta Tester feature to get notified about new beta releases. The beta version will not install automati