elect taxonomies to enable SEO options for them and include them in the sitemap.'=>'タクソノミーを選択してSEOオプションを有効にし、サイトマップに含めます。','Noindex Empty Category and Tag Archives'=>'空のカテゴリとタグアーカイブを Noindex として選択します','Setting empty archives to <code>noindex</code> is useful for avoiding indexation of thin content pages and dilution of page rank. As soon as a post is added, the page is updated to <code>index</code>.'=>'空のアーカイブを <code>noindex</code> に設定すると、シンコンテンツページのインデックス作成やページランクの希薄化を回避するのに役立ちます。投稿が追加されるとすぐに、ページが<code>index</code>に更新されます。 ','Nofollow Image File Links'=>'画像ファイルのリンクを Nofollow','Automatically add <code>rel="nofollow"</code> attribute for links pointing to external image files. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'外部画像ファイルを指すリンクの<code>rel="nofollow"</code>を自動的に追加します。この属性は、コンテンツが表示されるときに動的に適用され、保存されているコンテンツは変更されません。','Nofollow External Links'=>'外部リンクを Nofollow','Automatically add <code>rel="nofollow"</code> attribute for external links appearing in your posts, pages, and other post types. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'投稿、ページ、その他の投稿タイプに表示される外部リンクの<code>rel="nofollow"</code>属性を自動的に追加します。 この属性は、コンテンツが表示されるときに動的に適用され、保存されているコンテンツは変更されません。','Open External Links in New Tab/Window'=>'新しいタブ/ウィンドウで外部リンクを開く','Automatically add a <code>target="_blank"</code> attribute to external links appearing in your posts, pages, and other post types. The attributes are applied when the content is displayed, which does not change the stored content.'=>'投稿、ページ、その他の投稿タイプに表示される外部リンクに<code>target="_blank"</code>属性を自動的に追加します。 属性はコンテンツが表示されるときに適用され、保存されているコンテンツは変更されません。','Strip Category Base'=>'カテゴリベースを削除','Set capabilities here.'=>'ここで機能を設定します。','404 Monitor'=>'404 モニター','Set default values for the 404 error monitor here.'=>'ここで404エラーモニターのデフォルト値を設定します。','The 404 monitor will let you see if visitors or search engines bump into any <code>404 Not Found</code> error while browsing your site.'=>'404 モニターを使用すると、ユーザーまたは検索エンジンがサイトの閲覧中に<code>404 Not Found</code>エラーに遭遇したかどうかを確認できます。','Set default values for the redirection module from here.'=>'ここからリダイレクトモジュールのデフォルト値を設定します。','Learn more about Redirections.'=>'リダイレクションの詳細をご覧ください。','Set up temporary or permanent redirections. Combined with the 404 monitor, you can easily redirect faulty URLs on your site, or add custom redirections.'=>'一時的または永続的なリダイレクトを設定します。 404モニターと組み合わせると、サイト上の障害のあるURLを簡単にリダイレクトしたり、カスタムリダイレクトを追加したりできます。','Skip Step'=>'ステップをスキップ','Add missing ALT attributes'=>'不足しているalt属性を追加する','Use automatic structured data to mark up content, to help Google better understand your content\'s context for display in Search. You can set different defaults for your posts here.'=>'自動構造化データを使用してコンテンツをマークアップし、Google が検索で表示するコンテンツのコンテキストをよりよく理解できるようにします。 ここで、投稿にさまざまなデフォルトを設定できます。','Default rich snippet selected when creating a new product.'=>'新しい製品を作成するときに選択されるデフォルトのリッチスニペット。','Default rich snippet selected when creating a new post of this type. '=>'このタイプの新しい投稿を作成するときに選択されるデフォルトのリッチスニペット。 ','None (Click here to set one)'=>'なし（設定するにはここをクリック）','Google does not allow Person as the Publisher for articles. Organization will be used instead. You can read more about this <a href="%s" target="_blank">here</a>.'=>'Googleは、投稿の発行者として個人を許可していません。 代わりに組織が使用されます。これについて詳しくは、<a href="%s" target="_blank">こちら</a>をご覧ください。 ','404 + Redirection'=>'404 + リダイレクション','Setup Wizard - Rank Math'=>'セットアップウィザード - Rank Math','Advanced Options'=>'高度なオプション','Import plugin settings, global meta, sitemap settings, etc.'=>'プラグイン設定、グローバルメタ、サイトマップ設定などをインポートします。','Import Post Meta'=>'投稿メタのインポート','Import meta information of your posts/pages like the focus keyword, titles, descriptions, robots meta, OpenGraph info, etc.'=>'フォーカスキーワード、タイトル、説明、ロボットメタ、OpenGraph 情報などの投稿/ページのメタ情報をインポートします。','Import Term Meta'=>'単語メタのインポート','Import data like category, tag, and CPT meta data from SEO.'=>'カテゴリー、タグ、CPT メタデータなどのデータをSEOからインポートします。','Import Author Meta'=>'投稿者メタのインポート','Import meta information like titles, descriptions, focus keyword, robots meta, etc., of your author archive pages.'=>'投稿者アーカイブページのタイトル、説明、フォーカスキーワード、ロボットメタなどのメタ情報をインポートします。 ','Import Redirections'=>'リダイレクトのインポート','Unable to perform action this time.'=>'今回はアクションを実行できません。','Settings imported successfully.'=>'設定が正常にインポートされました。','Plugin deactivated successfully.'=>'プラグインを無効化しました。','Imported post meta for posts %1$s - %2$s out of %3$s '=>'%1$s の投稿のインポートされた投稿メタ - %2$s / %3$s ','Imported term meta for %s terms.'=>'%s 用語のインポートされた用語メタ。 ','Imported user meta for users %1$s - %2$s out of %3$s '=>'%1$s ユーザーのインポートされたユーザーメタ - %2$s / %3$s ','Imported %s redirections.'=>'インポートされた %s リダイレクト。','Settings import failed.'=>'設定のインポートに失敗しました。','Posts meta import failed.'=>'投稿のメタインポートに失敗しました。','Term meta import failed.'=>'単語メタのインポートに失敗しました。 ','User meta import failed.'=>'ユーザーメタのインポートに失敗しました。','There are no redirection to import.'=>'インポートするリダイレクトはありません。','Import all Schema data for Posts, Pages, and custom post types.'=>'投稿、ページ、およびカスタム投稿タイプのすべてのスキーマデータをインポートします。','Import AIO SEO plugin settings, global meta, sitemap settings, etc.'=>'AIO SEO プラグイン設定、グローバルメタ、サイトマップ設定などをインポートします。 ','Import meta information of your posts/pages like the titles, descriptions, robots meta, OpenGraph info, etc.'=>'タイトル、説明、ロボットメタ、OpenGraph 情報などの投稿 / ページのメタ情報をインポートします。 ','Plugin settings and site-wide meta data.'=>'プラグイン設定とサイト全体のメタデータ。','Next steps&hellip;'=>'次のステップ&hellip;','How to Properly Setup Rank Math'=>'Rank Math を適切に設定する方法','How to Import Data from Your Previous SEO Plugin'=>'以前の SEO プラグインからデータをインポートする方法 ','How to Make Your Posts Pass All the Tests'=>'投稿をすべてのテストに合格させる方法','Online Documentation'=>'オンラインドキュメント','Understand all the capabilities of Rank Math'=>'Rank Math のすべての機能を理解する','Ticket Support'=>'チケットサポート','Direct help from our qualified support team'=>'資格のあるサポートチームからの直接サポート','Titles &amp; Metas'=>'タイトルとメタ','Role Manager Settings'=>'Role Managerの設定','Choose the panels to export.'=>'エクスポートするパネルを選択します。','Import settings by locating settings file and clicking "Import settings".'=>'設定ファイルを見つけて「設定のインポート」をクリックして設定をインポートします。 ','Learn more about the Import/Export options.'=>'インポート/エクスポートオプションの詳細をご覧ください。','No plugin detected with importable data.'=>'インポート可能なデータでプラグインが検出されませんでした。','You have successfully activated Rank Math. If you find the plugin useful, %1$s feel free to recommend it to your friends or colleagues %2$s.'=>'Rank Math が正常にアクティブ化されました。プラグインが便利だと思ったら、%1$sお友達や同僚に気軽に勧めてください%2$s。 ','Your website is compatible to run Rank Math SEO'=>'サイトはRank Math SEOを実行するために互換性があります ','PHP DOM Extension installed'=>'PHP DOM 拡張機能がインストールされています','PHP DOM Extension missing'=>'PHP DOM 拡張機能がありません','PHP SimpleXML Extension installed'=>'PHP SimpleXML 拡張機能がインストールされています','PHP SimpleXML Extension missing'=>'PHP SimpleXML 拡張機能がありません','Your server is correctly configured to use Rank Math.'=>'サーバーは、ランク計算を使用するように正しく構成されています。','Your server is correctly configured to use this plugin.'=>'サーバーは、このプラグインを使用するように正しく構成されています。','Please resolve the issues above to be able to use all features of Rank Math plugin. If you are not sure how to do it, please contact your hosting provider.'=>'Rank Math プラグインのすべての機能を使用できるようにするには、上記の問題を解決してください。 方法がわからない場合は、ホスティングプロバイダーにお問い合わせください。 ','Please resolve the issues above to be able to use all SEO features. If you are not sure how to do it, please contact your hosting provider.'=>'上記の問題を解決して、すべてのSEO機能を使用できるようにしてください。 方法がわからない場合は、ホスティングプロバイダーにお問い合わせください。','The following active plugins on your site may cause conflict issues when used alongside Rank Math: '=>'サイトで次の有効化なプラグインをRank Mathと一緒に使用すると、競合の問題が発生する可能性があります。','The following active plugins on your site may cause conflict issues when used alongside this plugin: '=>'サイトで次の有効化なプラグインをこのプラグインと一緒に使用すると、競合の問題が発生する可能性があります。','No known conflicting plugins found.'=>'既知の競合するプラグインは見つかりませんでした。 ','Skip, Don\'t Import Now'=>'スキップして、今すぐインポートしない','SEO Tweaks'=>'SEOの微調整','Automate some of your SEO tasks like making external links nofollow, redirecting attachment pages, etc. %s'=>'外部リンクをnofollowします、添付ファイルページをリダイレクトするなど、SEO タスクの一部を自動化します。%s','Get 24x7 Support'=>'24時間年中無休をサポートします','Proceed to Help Page'=>'ヘルプページに進む','Setup Advanced Options'=>'詳細オプションを設定する','Proceed to Settings'=>'設定に進みます','Choose your Sitemap configuration and select which type of posts or pages you want to include in your Sitemaps. %s'=>'サイトマップ構成を選択し、サイトマップに含める投稿またはページのタイプを選択します。%s','Let us know a few things about your site&hellip;'=>'サイトについていくつか教えてください&hellip;','Setup Tutorial'=>'セットアップチュートリアル','Click here to learn how to setup Rank Math properly'=>'Rank Math を正しく設定する方法については、ここをクリックしてください','Search the Knowledge Base for answers to your questions:'=>'ナレッジベースで質問への回答を検索してください。 ','Please keep only one SEO plugin active, otherwise, you might lose your rankings and traffic. %s.'=>'1つのSEOプラグインのみをアクティブにしてください。そうしないと、ランキングとトラフィックが失われる可能性があります。%s。 ','Please keep only one Sitemap plugin active, otherwise, you might lose your rankings and traffic. %s.'=>'1つのサイトマッププラグインのみをアクティブにしてください。そうしないと、ランキングとトラフィックが失われる可能性があります。%s。 ','Edit Homepage SEO Settings'=>'ホームページのSEO設定を編集','SEO Settings for %s'=>'%sの SEO 設定','Edit default SEO settings for this post type'=>'この投稿タイプのデフォルトのSEO設定を編集','Edit SEO settings for this archive page'=>'このアーカイブページの SEO 設定を編集します','SEO Settings for Date Archives'=>'日付アーカイブのSEO設定','SEO Settings for Search Page'=>'検索ページのSEO設定','Edit SEO settings for the search results page'=>'検索結果ページのSEO設定を編集','Mark this page'=>'このページにマークを付ける','As Pillar Content'=>'ピラーコンテンツ','As NoIndex'=>'noindex','As NoFollow'=>'nofollow','External Tools'=>'外部ツール','Google PageSpeed'=>'Google PageSpeed','Google PageSpeed Insights'=>'Google PageSpeed Insights','Google Cache'=>'Google Cache','See Google\'s cached version of your site'=>'Google のキャッシュバージョンのサイトを見る','Facebook Debugger'=>'Facebook Debugger','Facebook Sharing Debugger'=>'Facebook Sharing Debugger','Records the URLs on which visitors & search engines run into 404 Errors. You can also turn on Redirections to redirect the error causing URLs to other URLs.'=>'訪問者と検索エンジンが404エラーに遭遇した URL を記録します。 リダイレクトをオンにして、エラーの原因となっている URL を他の URL にリダイレクトすることもできます。','Enable support for the structured data, which adds Schema code in your website, resulting in rich search results, better CTR and more traffic.'=>'構造化データのサポートを有効にします。これにより、サイトにスキーマコードが追加され、検索結果が豊富になり、クリック率が向上し、トラフィックが増加します。','Connect Rank Math with Google Search Console to see the most important information from Google directly in your WordPress dashboard.'=>'Rank Math を Google 検索コンソールに接続して、WordPress ダッシュボードに直接 Google からの最も重要な情報を表示します。','Please activate WooCommerce plugin to use this module.'=>'このモジュールを使用するには、WooCommerce プラグインを有効化にしてください。','Link Counter'=>'リンクカウンター','Items per page'=>'ページあたりの項目','Title of the current post/page'=>'現在の投稿 / ページのタイトル','Post Title of parent page'=>'親ページの投稿タイトル','Title of the parent page of the current post/page'=>'現在の投稿/ページの親ページのタイトル','Separator character, as set in the Title Settings'=>'タイトル設定で設定された区切り文字','Publication date of the current post/page <strong>OR</strong> specified date on date archives'=>'現在の投稿/ページの公開日<strong>または</strong>日付アーカイブの指定日','Last modification date of the current post/page'=>'現在の投稿 / ページの最終変更日','Excerpt of the current post (or auto-generated if it does not exist)'=>'現在の投稿の抜粋（または存在しない場合は自動生成）','Excerpt of the current post (without auto-generation)'=>'現在の投稿の抜粋（自動生成なし）','First tag (alphabetically) associated to the current post <strong>OR</strong> current tag on tag archives'=>'タグアーカイブの現在の投稿<strong>または</strong>の現在のタグに（アルファベット順に）関連付けられている最初のタグ ','Comma-separated list of tags associated to the current post'=>'現在の投稿に関連付けられているタグのカンマ区切りリスト','First category (alphabetically) associated to the current post <strong>OR</strong> current category on category archives'=>'カテゴリーアーカイブの現在の投稿<strong>または</strong>の現在のカテゴリーに（アルファベット順に）関連付けられている最初のタグ ','Comma-separated list of categories associated to the current post'=>'現在の投稿に関連付けられているカテゴリーのカンマ区切りリスト','Current Term'=>'現在の単語','Current term name'=>'現在の単語の名前','Example Term'=>'単語の例','Term Description'=>'語句の説明','Current term description'=>'現在の単語の説明','Example Term Description'=>'例の単語の説明','Search Query'=>'検索クエリ','Search query (only available on search results page)'=>'検索クエリ（検索結果ページでのみ使用可能）','example search'=>'サンプル検索','Post Author'=>'著者','Display author\'s nicename of the current post, page or author archive.'=>'現在の投稿、ページ、または投稿者アーカイブの投稿者のナイスネームを表示します。','Author\'s biographical info of the current post, page or author archive.'=>'現在の投稿、ページ、または投稿者のアーカイブに関する投稿者の経歴情報。','Author\'s user ID of the current post, page or author archive.'=>'現在の投稿、ページ、または投稿者アーカイブの投稿者のユーザーID。','ID of the current post/page'=>'現在の投稿 / ページの ID','Page number with context (i.e. page 2 of 4). Only displayed on page 2 and above.'=>'コンテキスト付きのページ番号（つまり、2/4ページ）。 2 ページ以上にのみ表示されます。','Current server day'=>'現在のサーバーの日付','Current server month'=>'現在のサーバーの月','Current server year'=>'現在のサーバーの年','Post Type Name Singular'=>'投稿タイプ名単数','Name of current post type (singular)'=>'現在の投稿タイプの名前（単数）','Post Type Name Plural'=>'投稿タイプ名複数','Name of current post type (plural)'=>'現在の投稿タイプの名前（複数形）','Custom Field (advanced)'=>'カスタムフィールド（詳細）','Custom field value.'=>'カスタムフィールド値','Custom field value'=>'カスタムフィールド値','Date Published (advanced)'=>'公開日（詳細）','Publish date with custom formatting pattern.'=>'カスタムフォーマットパターンで日付を公開します。','Date Modified (advanced)'=>'変更日（詳細）','Modified date with custom formatting pattern.'=>'カスタムフォーマットパターンで変更された日付。','Current Time (advanced)'=>'現在の時刻（詳細）','Current server time with custom formatting pattern.'=>'カスタムフォーマットパターンを使用した現在のサーバー時間。','Categories (advanced)'=>'カテゴリー（上級）','Output list of categories associated to the current post, with customization options.'=>'現在の投稿に関連付けられているカテゴリーのリストを、カスタマイズオプションとともに出力します。 ','Tags (advanced)'=>'タグ（上級）','Output list of tags associated to the current post, with customization options.'=>'現在の投稿に関連付けられているタグのリストを、カスタマイズオプションとともに出力します。','Starts at 1 and increments by 1.'=>'1 から始まり、1 ずつ増加します。','Global Meta'=>'グローバルメタ','Social Meta'=>'ソーシャルメタ','Post Formats Archive'=>'投稿フォーマットアーカイブ','SEO options related to featured images and media appearing in your post content. %s.'=>'投稿コンテンツに表示される注目の画像やメディアに関連する SEO オプション。%s','Leave the field empty to let WordPress handle the contents dynamically. If an actual robots.txt file is present in the root folder of your site, this option won\'t take effect and you have to edit the file directly, or delete it and then edit from here.'=>'WordPress がコンテンツを動的に処理できるようにするには、フィールドを空のままにします。実際の robots.txt ファイルがサイトのルートフォルダにある場合、このオプションは有効になりません。ファイルを直接編集するか、ファイルを削除してからここから編集する必要があります。 ','Failed to backup .htaccess file. Please check file permissions.'=>'.htaccess ファイルのバックアップに失敗しました。 ファイルのアクセス許可を確認してください。','Failed to update .htaccess file. Please check file permissions.'=>'.htaccess ファイルの更新に失敗しました。 ファイルのアクセス許可を確認してください。','.htaccess file updated successfully.'=>'.htaccess ファイルが正常に更新されました。','Hours:'=>'時間：','Play icon'=>'Play アイコン','Prevents pages from being indexed and displayed in search engine result pages'=>'ページがインデックスに登録されて検索エンジンの結果ページに表示されないようにします','No Follow'=>'No Follow','Prevents search engines from following links on the pages'=>'検索エンジンがページ上のリンクをたどることを防ぎます','Prevents search engines from showing Cached links for pages'=>'検索エンジンがページのキャッシュされたリンクを表示しないようにします','Prevents a snippet from being shown in the search results'=>'スニペットが検索結果に表示されないようにします','Software Application'=>'ソフトウェアアプリケーション','I just installed @RankMathSEO #WordPress Plugin. It looks great! %s'=>'@RankMathSEO #WordPress プラグインをインストールしました。よかった！  %s','I just installed Rank Math SEO WordPress Plugin. It looks promising!'=>'Rank Math SEO ワードプレスプラグインをインストールしました。 有望に見えます！','Titles & Meta Settings'=>'タイトルとメタの設定','404 Monitor Log'=>'404 ログの監視','Link Builder'=>'リンクビルダー','Site-Wide Analysis'=>'サイト全体の分析','On-Page Analysis'=>'ページ上の分析','On-Page General Settings'=>'ページ上の一般設定','On-Page Advanced Settings'=>'ページ上の詳細設定','On-Page Social Settings'=>'ページ上のソーシャル設定','Top Admin Bar'=>'トップ管理バー','Robots Meta'=>'robots のメタ','Summary Card with Large Image'=>'大きな画像の要約カード','Summary Card'=>'サマリーカード','%d log(s) deleted.'=>'%d ログが削除されました。','Log cleared - %d items deleted.'=>'ログがクリアされました - %d 項目が削除されました。','Are you sure you wish to delete all 404 error logs?'=>'404 エラーログをすべて削除してもよろしいですか？','Review 404 errors on your site'=>'サイトの 404 エラーを確認する','Log item successfully deleted.'=>'ログ項目が正常に削除されました。','The 404 error log is empty.'=>'404 エラーログは空です。','User-Agent'=>'ユーザーエージェント','Hits'=>'ヒット数','Access Time'=>'アクセス時間','Hovering over a row in the list will display action links that allow you to manage the item. You can perform the following actions:'=>'リストの行にカーソルを合わせると、項目を管理できるアクションリンクが表示されます。 次のアクションを実行できます。','<strong>View Details</strong> shows details about the 404 requests.'=>'<strong>詳細の表示</strong>には、404 リクエストの詳細が表示されます。','<strong>Redirect</strong> takes you to the Redirections manager to redirect the 404 URL.'=>'<strong>リダイレクト</strong> を使用すると、リダイレクトマネージャに移動して 404 URL をリダイレクトします。 ','<strong>Delete</strong> permanently removes the item from the list.'=>'<strong>削除</strong> すると、リストからアイテムが完全に削除されます。 ','You can also redirect or delete multiple items at once. Selecting multiple items to redirect allows you to redirect them to a single URL.'=>'複数の項目を一度にリダイレクトまたは削除することもできます。 リダイレクトする複数の項目を選択すると、それらを単一の URL にリダイレクトできます。','You can customize the display of this screen\'s contents in a number of ways:'=>'この画面のコンテンツの表示は、さまざまな方法でカスタマイズできます。','You can hide/display columns based on your needs.'=>'必要に応じて列を非表示/表示できます。','You can decide how many items to list per screen using the Screen Options tab.'=>'「表示オプション」タブを使用して、画面ごとに一覧表示する項目の数を決定できます。','You can search items using the search form at the top.'=>'上部の検索フォームを使用して項目を検索できます。','You can reorder the list by clicking on the column headings. '=>'列見出しをクリックすると、リストを並べ替えることができます。','If you have hundreds of 404 errors, your error log might increase quickly. Only choose this option if you have a very few 404s and are unable to replicate the 404 error on a particular URL from your end.'=>'404 エラーが数百ある場合、エラーログが急速に増加する可能性があります。このオプションを選択するのは、404 が非常に少なく、特定の URL で 404 エラーを複製できない場合のみにしてください。','The Simple mode only logs URI and access time, while the Advanced mode creates detailed logs including additional information such as the Referer URL.'=>'シンプルモードは URI とアクセス時間のみをログに記録しますが、高度モードはリファラー URL などの追加情報を含む詳細なログを作成します。','Log Limit'=>'ログ制限','Sets the max number of rows in a log. Set to 0 to disable the limit.'=>'ログの最大行数を設定します。 制限を無効にするには、0に設定します。','Enter URIs or keywords you wish to prevent from getting logged by the 404 monitor.'=>'404 モニターによってログに記録されないようにするURIまたはキーワードを入力します。','Ignore Query Parameters'=>'クエリー変数を無視する','Turn ON to ignore all query parameters (the part after a question mark in a URL) when logging 404 errors.'=>'オンにすると、404 エラーをログに記録するときに、すべてのクエリークエリー（URL の疑問符の後の部分）が無視されます。','Choose whether the site represents a person or an organization.'=>'サイトが個人を表すか組織を表すかを選択します。','URL of the item.'=>'項目の URL。','Search engines display your email address.'=>'検索エンジンはメールアドレスを表示します。','Search engines may prominently display your contact phone number for mobile users.'=>'検索エンジンは、モバイルユーザーの連絡先電話番号を目立つように表示する場合があります。 ','Address Format'=>'住所形式','Format used when the address is displayed using the <code>[rank_math_contact_info]</code> shortcode.<br><strong>Available Tags: {address}, {locality}, {region}, {postalcode}, {country}, {gps}</strong>'=>'<code>[rank_math_contact_info]</code>のショートコードを使用してアドレスを表示するときに使用される形式。<br><strong>使用可能なタグ：{address}、{locality}、{region}、{postalcode}、{country}、{gps}</strong>','Select opening hours. You can add multiple sets if you have different opening or closing hours on some days or if you have a mid-day break. Times are specified using 24:00 time.'=>'営業時間を選択します。 ある日の営業時間と閉店時間が異なる場合、または正午の休憩がある場合は、複数のセットを追加できます。 時間は 24:00 の時間を使用して指定されます。','e.g. 09:00-17:00'=>'例：09:00〜17:00','Opening Hours Format'=>'営業時間の形式','Time format used in the contact shortcode.'=>'連絡先のショートコードで使用される時間形式。','Credit Card Support'=>'クレジットカードのサポート','Baggage Tracking'=>'手荷物のトラッキング','Roadside Assistance'=>'道端での援助','Package Tracking'=>'荷物追跡','Format: +1-401-555-1212'=>'フォーマット：+1-401-555-1212','The price range of the business, for example $$$.'=>'ビジネスの価格帯、例えば $$$。','Select a page on your site where you want to show the LocalBusiness meta data.'=>'LocalBusiness のメタデータを表示するサイト上のページを選択します。','Google Maps API Key'=>'Google Maps API キー','An API Key is required to display embedded Google Maps on your site. Get it here: %s'=>'サイトに埋め込まれた Google Maps を表示するには、API キーが必要です。 ここで入手：%s','Google Maps Embed API'=>'Google Maps Embed API','Latitude and longitude values separated by comma.'=>'緯度と経度の値はコンマで区切られます。','This field must not be empty.'=>'このフィールドは空であってはなりません。','Redirection Count'=>'リダイレクションカウント','Redirection Hits'=>'リダイレクションヒット','No valid action found.'=>'有効なアクションが見つかりません。','Redirection successfully activated.'=>'リダイレクトが正常に有効化した。','Redirection successfully deactivated.'=>'リダイレクトが正常に無効化した。','Redirection successfully moved to Trash.'=>'リダイレクトは正常にゴミ箱に移動しました。','%d redirection(s) successfully deleted.'=>'%d リダイレクトは正常に削除されました。','Invalid regex pattern: %s'=>'無効な正規表現パターン：%s','Redirection successfully deleted.'=>'リダイレクトは正常に削除されました。','New redirection created.'=>'新しいリダイレクトが作成されました。','Create and edit redirections'=>'リダイレクトを作成および編集する','Redirect the current URL'=>'現在のURLをリダイレクトする','No redirections found in Trash.'=>'ゴミ箱にリダイレクトが見つかりません。','No redirections added yet. <a href="#" class="rank-math-add-new-redirection">Add New Redirection</a>'=>'リダイレクトはまだ追加されていません。<a href="#" class="rank-math-add-new-redirection">新しいリダイレクトを追加</a>','SEO Notice: you just changed the slug of a %1$s and Rank Math has automatically created a redirection. You can edit the redirection by <a href="%2$s">clicking here</a>.'=>'SEO の注意：%1$s のスラッグを変更したところ、Rank Math が自動的にリダイレクトを作成しました。<a href="%2$s">ここをクリックする</a>と、リダイレクトを編集できます。','<strong>SEO Notice:</strong> A previously published %1$s has been moved to trash. You may redirect <code>%2$s</code> to <a href="%3$s">a new url</a>.'=>'<strong>SEO 通知：</strong>以前に公開された %1$s はゴミ箱に移動されました。<code>%2$s</code>を<a href="%3$s">新しいURL</a>にリダイレクトできます。','Redirection Debugger'=>'リダイレクションデバッガー','Redirecting from '=>'ここからリダイレクト: ',' To '=>'行き先: ','Redirecting in %s seconds...'=>'%s 秒でリダイレクトしています...','Stop Redirection'=>'リダイレクトを停止します','Continue redirecting'=>'リダイレクトを続行します','Manage This Redirection'=>'このリダイレクトを管理する','Manage All Redirections'=>'リダイレクトを管理','<strong>Note:</strong> This interstitial page is displayed only to administrators. Site visitors are redirected without delay.'=>'<strong>ご注意：</strong> このインタースティシャルページは、管理者にのみ表示されます。 サイト訪問者は遅滞なくリダイレクトされます。 ','<strong>Edit</strong> redirection details: from/to URLs and the redirection type.'=>'リダイレクトの詳細を<strong>編集します</strong>：差出人/宛先 URL とリダイレクトタイプ。','<strong>Activate/Deactivate</strong> redirections. Deactivated redirections do not take effect on your site.'=>'リダイレクトを<strong>有効化 / 無効化します</strong>。 無効化されたリダイレクトは、サイトでは有効になりません。','<strong>Delete</strong> permanently removes the redirection.'=>'<strong>削除する</strong>と、リダイレクトが完全に削除されます。','You can also activate, deactivate, or delete multiple items at once using the Bulk Actions dropdown.'=>'「一括操作」ドロップダウンを使用して、一度に複数のアイテムを有効化、無効化、または削除することもできます。 ','Here you can set up custom redirections. It is important to choose the right type of redirection.'=>'ここで、カスタムリダイレクトを設定できます。 適切なタイプのリダイレクトを選択することが重要です。 ','Using a 302 <em>temporary</em> redirection is useful when you want to test a new page for client feedback temporarily without affecting the SEO scores of the original page.'=>'302の<em>一時的</em>なリダイレクトを使用すると、元のページのSEOスコアに影響を与えずに、クライアントのフィードバックについて新しいページを一時的にテストする場合に役立ちます。','301 redirections are <em>permanent</em>. The old URL will be removed in search engines and replaced by the new one, passing on SearchRank and other SEO scores. Browsers may also store the new URL in cache and redirect to it even after the redirection is deleted from the list here.'=>'301 リダイレクトは<em>永続的</em>です。古い URL は検索エンジンで削除され、新しいURLに置き換えられ、 SearchRank やその他の SEO スコアが渡されます。ブラウザーは、リダイレクトがここのリストから削除された後でも、新しい URL をキャッシュに保存し、リダイレクトする場合があります。','Redirections can be exported to your .htaccess file for faster redirections, in SEO > Settings > Import/Export.'=>'「SEO」> 「設定」> 「インポート/エクスポート」で、リダイレクトを .htaccess ファイルにエクスポートしてリダイレクトを高速化できます。 ','Export to .htaccess'=>'.htaccess にエクスポート','Export to Nginx config file'=>'Nginx 構成ファイルにエクスポート','Debug Redirections'=>'リダイレクションをデバッグ','Display the Debug Console instead of being redirected. Administrators only.'=>'リダイレクトされる代わりに、デバッグコンソールを表示します。 管理者のみ。','Fallback Behavior'=>'フォールバック動作','Default 404'=>'デフォルト 404','Redirect to Homepage'=>'ホームページにリダイレクト','Custom Redirection'=>'カスタムリダイレクト','Custom Url '=>'カスタム URL','Auto Post Redirect'=>'自動投稿リダイレクト','Extend the functionality of WordPress by creating redirects in our plugin when you change the slug of a post, page, category or a CPT. You can modify the redirection further according to your needs.'=>'投稿、ページ、カテゴリー、または CPT のスラッグを変更したときにプラグインにリダイレクトを作成して、WordPress の機能を拡張します。必要に応じて、リダイレクトをさらに変更できます。','Course Provider'=>'コースプロバイダー','Course Provider URL'=>'コースプロバイダーのURL','Event Status'=>'イベントのステータス','Ticket URL'=>'チケット URL','Entry Price'=>'エントリー価格','Availability Starts'=>'可用性が始まります','Stock Inventory'=>'棚卸品','Salary Currency'=>'給与の通貨','Expiry Posted'=>'公開された有効期限','Unpublish when expired'=>'これが期限切れになったときに非公開','Opening Time'=>'開始時間','Closing Time'=>'閉店時間','Product Brand'=>'製品ブランド','Product Currency'=>'製品通貨','Product In-Stock'=>'在庫のある製品','Recipe Yield'=>'レシピー歩留まり','Preparation Time'=>'準備時間','Recipe Video Thumbnail'=>'レシピ動画サムネイル','Recipe Video Name'=>'レシピ動画ネーム','Recipe Video Description'=>'レシピ動画の説明','Recipe Ingredients'=>'レシピー材料','Recipe Instructions'=>'レシピーの説明','Serves Cuisine'=>'料理','Menu URL'=>'メニューの URL','Price Currency'=>'価格通貨','Operating System'=>'オペレーティング・システム','Application Category'=>'アプリのカテゴリー','You are not authorized to perform this action.'=>'この操作の実行権限がありません。','Control which user has access to which options of Rank Math. %s'=>'どのユーザーが Rank Math のどのオプションにアクセスできるかを制御します。 %s','Update Capabilities'=>'更新機能','Bad request. Please check the code.'=>'要求の形式が正しくありません。 コードを確認してください。','Not found'=>'見つかりません','Total Keywords'=>'総キーワード','Average Position'=>'平均ポジション','Not a valid settings founds to delete cache.'=>'キャッシュを削除するための有効な設定が見つかりません。','Google oAuth is not authorized.'=>'Google oAuth は承認されていません。','Fetching in Progress'=>'進行中のフェッチ','Data Rows: %s'=>'データ行：%s','Site-wide analysis'=>'サイト全体の分析','Analyze this Page'=>'このページを分析する','SEO Analysis for this page'=>'このページの SEO 分析','SEO Score'=>'SEO スコア','Passed Tests'=>'合格したテスト','Failed Tests'=>'失敗したテスト','How to fix'=>'直し方','Your theme may display the Site Tagline, and it can also be used in SEO titles &amp; descriptions. Set it to something unique. You can change it by navigating to <a href="%s">Settings &gt; General</a>.'=>'テーマにサイトタグラインが表示される場合があります。また、SEO タイトルや SEO タイトルでも使用できます。 説明。 何かユニークなものに設定してください。<a href="%s">「設定」>「一般」</a>に移動して変更できます。 ','Most WordPress themes place your site\'s tagline in a prominent position (inside header tags near the top of the page).  Using the right tagline can give your site an SEO boost.'=>'ほとんどの WordPress テーマは、サイトのタグラインを目立つ位置（ページ上部近くのヘッダータグ内）に配置します。適切なタグラインを使用すると、サイトの SEO を向上させることができます。 ','Unfortunately, the standard WordPress tagline is "Just Another WordPress site."  That\'s pretty sloppy looking, and it does nothing for your SEO.  In fact, it\'s actually a security risk - it makes it easy for hackers with a WordPress exploit to locate your site with an automated search.'=>'残念ながら、標準の WordPress タグラインは「Just Another WordPress site」です。それは SEO には役立ちません。実際、これは実際にはセキュリティ上のリスクです。WordPressを悪用したハッカーが、自動検索でサイトを簡単に見つけることができます。','Changing your tagline is very easy.  Just head on over to <a target="_blank" href="%1$s">Settings - General</a> in WordPress\'s admin menu (on the left), or click on the link in this sentence.'=>'タグラインの変更はとても簡単です。 WordPress 管理メニュー（左側）の<a target="_blank" href="%1$s">「設定」-「一般」</a>に移動するか、この文のリンクをクリックしてください。','The tagline is the second option.  Choose a tagline that summarizes your site in a few words.  The tagline is also a good place to use your main keyword.'=>'キャッチフレーズは 2 番目のオプションです。サイトをいくつかの言葉で要約するタグラインを選択してください。 キャッチフレーズは、メインキーワードを使用するのにも適した場所です。','For the best SEO results, use a custom permalink structure, preferably one that includes the post title (<code>%%postname%%</code>). You can change it by navigating to <a href="%s">Settings &gt; Permalinks</a>'=>'最良の SEO 結果を得るには、カスタムのパーマリンク構造を使用します。できれば、投稿のタイトル(<code>%%postname%%</code>)を含む構造を使用してください。<a href="%s">「設定」> 「パーマリンク」に移動して変更できます</a>','The standard permalink structure is pretty ugly - WordPress generates offputting URLs like: http://www.yoursite.com/?p=99'=>'標準のパーマリンク構造はかなり醜いです - WordPress は次のような不快な URL を生成します：http://www.yoursite.com/?p=99','It\'s not very kind on the eyes, and it does nothing for your site\'s SEO.  In fact, it can hurt it - Google\'s bot is quite cautious about crawling pages that look auto-generated.'=>'目にはあまり親切ではなく、サイトの SEO には何の影響もありません。 実際、それはそれを傷つける可能性があります- Google のボットは、自動生成されたように見えるページのクロールについて非常に慎重です。','Fortunately, it\'s very easy to fix.  Just hop on over to <a target="_blank" href="%1$s">Settings - Permalinks</a>.  Then chose the "Post Name" option.'=>'幸い、修正は非常に簡単です。<a target="_blank" href="%1$s">「設定」-「パーマリンク」</a>に移動するだけです。 次に、「投稿名」オプションを選択します。 ','This option will replace the "?p=99" part of the URL with the post\'s title, like this: http://www.yoursite.com/my-amazing-post-title/'=>'このオプションは、URLの「?p=99」の部分を次のように投稿のタイトルに置き換えます：http://www.yoursite.com/my-amazing-post-title/','This looks nice for readers - and it gets your keywords into the URL (keywords in the URL is a ranking factor).'=>'これは読者にとっては見栄えがよく、キーワードを URL に取り込みます（URL 内のキーワードはランキング要素です）。','Focus Keywords'=>'重要なキーワード','Setting focus keywords for your posts allows Rank Math to analyse the content.'=>'投稿にフォーカスキーワードを設定すると、Rank Math でコンテンツを分析できます。','Rank Math allows you to set a focus keyword for every post and page you write - the option is in the "Meta Box", which appears under the text editor in the screen where you write and edit content.'=>'Rank Math では、書くすべての投稿とページにフォーカスキーワードを設定することができます-オプションは、コンテンツを書いたり編集したりする画面のテキストエディタの下に表示される「メタボックス」にあります。 ','Rank Math uses these focus keywords to analyze your on-page content.  It can tell if you\'ve done a good job of optimizing your text to rank for these keywords.'=>'Rank Math は、これらのフォーカスキーワードを使用して、ページ上のコンテンツを分析します。 これらのキーワードのランク付けのためにテキストを最適化するのに良い仕事をしたかどうかを知ることができます。 ','Of course, if you don\'t give Rank Math a focus keyword to work with, it can\'t give you any useful feedback.'=>'もちろん、Rank Math にフォーカスキーワードを指定しないと、有用なフィードバックを提供できません。','Fixing this issue is easy - just edit the post, and set a Focus Keyword.  Then follow Rank Math\'s analysis to improve your rankings.'=>'この問題の修正は簡単です。投稿を編集して、フォーカスキーワードを設定するだけです。 次に、Rank Math の分析に従ってランキングを改善します。','Post Titles Missing Focus Keywords'=>'フォーカスキーワードがない投稿タイトル','Make sure the focus keywords you set for the posts appear in their titles.'=>'投稿に設定したフォーカスキーワードがタイトルに表示されていることを確認してください。','HTML Page Titles play a large role in Google\'s ranking algorithm.  When you add a Focus Keyword to a post or page, Rank Math will check to see that you used the keyword in the title.  If it finds any posts or pages that are missing the keyword in the title, it will tell you here.'=>'HTML ページタイトルは、Google のランキングアルゴリズムで大きな役割を果たします。 投稿またはページにフォーカスキーワードを追加すると、ランク数学は、タイトルでキーワードを使用したかどうかを確認します。 タイトルにキーワードがない投稿やページが見つかった場合は、ここに表示されます。 ','Fixing the issue is simple - just edit the post/page and add the focus keyword(s) to the title.'=>'問題の修正は簡単です。投稿/ページを編集して、タイトルにフォーカスキーワードを追加するだけです。','Register at Google Search Console and verificate your site by adding the code to <a href="%1$s">Settings &gt; Verificate Tools</a>, then navigate to <a href="%2$s">Settings &gt; Search Console</a> to authenticate and link your site.'=>'Google Search Console に登録し、<a href="%1$s">「設定」> 「ツールを検証」</a>にコードを追加してサイトを検証し、<a href="%2$s">「設定」> 「検索コンソール」</a>に移動して、サイトを認証およびリンクします。','Google\'s Search Console is a vital source of information concerning your rankings and click-through rates.  Rank Math can import this data, so you don\'t have to log into your Google account to get the data you need.'=>'Google Search Console は、ランキングとクリック率に関する重要な情報源です。Rank Math はこのデータをインポートできるため、必要なデータを取得するために Google アカウントにログインする必要はありません。','You can integrate the Google Search Console with Rank math in the <a href="%1$s" target="_blank">Search Console tab</a>. of Rank Math\'s General Settings menu.'=>'Google Search Console を Rank Math と統合するには、ランク計算の「一般設定」メニューの<a href="%1$s" target="_blank">「Search Console」</a>タブを使用します。 ','Read <a href="%1$s" target="_blank">this article</a> for detailed instructions on setting up your Google Webmaster account and getting Rank Math to work with the Google Search Console.'=>'Google Webmaster アカウントを設定し、ランク数学をGoogle Search Consoleで機能させるための詳細な手順については、<a href="%1$s" target="_blank">この記事</a>をお読みください。','XML sitemaps are a special type of text file that tells search engines about the structure of your site. They\'re a list of all the resources (pages and files) you would like the search engine to index. You can assign different priorities, so certain pages will be crawled first. Before XML sitemaps, search engines were limited to indexing the content they could find by following links. That\'s still an important feature for search engine spiders, but XML sitemaps have made it easier for content creators and search engines to collaborate.'=>'XML サイトマップは、サイトの構造について検索エンジンに通知する特殊なタイプのテキストファイルです。 これらは、検索エンジンでインデックスを作成するすべてのリソース（ページとファイル）のリストです。 さまざまな優先順位を割り当てることができるため、特定のページが最初にクロールされます。 XML サイトマップが登場する前は、検索エンジンはリンクをたどることで見つけたコンテンツのインデックス作成に限定されていました。 これは検索エンジンスパイダーにとって依然として重要な機能ですが、XML サイトマップにより、コンテンツ作成者と検索エンジンのコラボレーションが容易になりました。','If you don\'t have an XML sitemap, the best option is to install a plugin that creates sitemaps for you. That way you\'ll know the sitemap will always be up-to-date. Plugins can also automatically ping the search engines when the XML file is updated. The Rank Math WordPress plugin gives you complete control over your site\'s XML sitemaps. You can control the settings for each page as you write or edit it, and Rank Math will ping Google as soon as you submit your edits. This results in fast crawls and indexing.'=>'XML サイトマップがない場合は、サイトマップを作成するプラグインをインストールするのが最善の方法です。 そうすれば、サイトマップが常に最新であることがわかります。 プラグインは、XML ファイルが更新されたときに検索エンジンに自動的にpingを実行することもできます。 Rank Math の WordPress プラグインを使用すると、サイトの XML サイトマップを完全に制御できます。 ページを作成または編集するときに各ページの設定を制御できます。編集を送信するとすぐに、Rank Math がGoogle に ping を送信します。 これにより、クロールとインデックス作成が高速になります。','Your Site Tagline is set to the default value <em>Just another WordPress site</em>.'=>'サイトタグラインはデフォルト値  <em>Just another WordPress site</em> に設定されています。','Your Site Tagline is set to a custom value.'=>'サイトタグラインはカスタム値に設定されています。','Permalinks are set to the default value. <em>Pretty permalinks</em> are disabled. '=>'パーマリンクはデフォルト値に設定されています。<em>Pretty パーマリンク</em>が無効になっています。','Permalinks are set to a custom structure but the post titles do not appear in the permalinks.'=>'パーマリンクはカスタム構造に設定されていますが、投稿のタイトルはパーマリンクに表示されません。','Post permalink structure is set to %s.'=>'投稿パーマリンク構造は%sに設定されます。','Google Search Console has been linked.'=>'Google Search Console がリンクされました。 ','You have not linked Google Search Console yet.'=>'Google Search Console はまだリンクしていません。','All published posts have focus keywords set.'=>'公開されたすべての投稿には、フォーカスキーワードが設定されています。','There are %s with no focus keyword set.'=>'フォーカスキーワードが設定されていない%sがあります。','Focus keywords appear in the titles of published posts where it is set.'=>'フォーカスキーワードは、設定されている公開投稿のタイトルに表示されます。','+%d More...'=>'+さらに%d ...','Your site has one or more sitemaps.'=>'サイトに1つ以上のサイトマップがあります。','Selected page: %s'=>'選択したページ：%s','Change URL'=>'URLを変更する','Start Page Analysis'=>'ページ分析を開始します','Analysing Page&hellip;'=>'ページの分析&hellip;','Analysing Website&hellip;'=>'サイトの分析&hellip;','This tab contains General settings related to the XML sitemaps.'=>'このタブには、XML サイトマップに関連する一般設定が含まれています。','Set the sitemap options for author archive pages. %s.'=>'投稿者アーカイブページのサイトマップオプションを設定します。%s','your product pages'=>'製品ページ ','single %s'=>'単一 %s','Sitemap URL: %s'=>'サイトマップ URL：%s','Please note that this will add the attachment page URLs to the sitemap, not direct image URLs.'=>'これにより、直接の画像URLではなく、添付ファイルページのURLがサイトマップに追加されることに注意してください。','your product %s pages'=>'製品の %s ページ','Rank Math has detected new post types: %1$s. You may want to check the settings of the <a href="%2$s">Titles &amp; Meta page</a> and <a href="%3$s">the Sitemap</a>.'=>'Rank Math は新しい投稿タイプを検出しました：%1$s。<a href="%2$s">タイトル&amp;メタページ</a>と<a href="%3$s">サイトマップ</a>の設定を確認することをお勧めします。','XML Sitemap %1$s %2$s'=>'XML サイトマップ %1$s %2$s','Exclude User Roles'=>'ユーザーロールを除外する','Exclude Users'=>'ユーザーを除外する','Add user IDs, separated by commas, to exclude them from the sitemap.'=>'ユーザーIDをコンマで区切って追加し、サイトマップから除外します。','Links Per Sitemap'=>'サイトマップごとのリンク','Max number of links on each sitemap page.'=>'各サイトマップページのリンクの最大数。','Images in Sitemaps'=>'サイトマップの画像','Include reference to images from the post content in sitemaps. This helps search engines index the important images on your pages.'=>'投稿コンテンツからの画像への参照をサイトマップに含めます。 これは、検索エンジンがページ上の重要な画像のインデックスを作成するのに役立ちます。','Include Featured Images'=>'アイキャッチ画像を含める','Include the Featured Image too, even if it does not appear directly in the post content.'=>'投稿コンテンツに直接表示されていない場合でも、アイキャッチ画像も含めてください。','Exclude Posts'=>'投稿を除外','Enter post IDs of posts you want to exclude from the sitemap, separated by commas. This option **applies** to all posts types including posts, pages, and custom post types.'=>'サイトマップから除外する投稿の投稿IDをカンマで区切って入力します。 このオプションは、投稿、ページ、カスタム投稿タイプを含むすべての投稿タイプに**適用されます**。 ','Exclude Terms'=>'単語を除外する','Add term IDs, separated by comma. This option is applied for all taxonomies.'=>'単語 IDをコンマで区切って追加します。 このオプションは、すべての分類法に適用されます。','Include in Sitemap'=>'サイトマップに含める','Include this post type in the XML sitemap.'=>'この投稿タイプをXMLサイトマップに含めます。','Image Custom Fields'=>'画像カスタムフィールド','Insert custom field (post meta) names which contain image URLs to include them in the sitemaps. Add one per line.'=>'画像のURLを含むカスタムフィールド（投稿メタ）名を挿入して、サイトマップに含めます。 1行に1つずつ追加します。','Include archive pages for terms of this taxonomy in the XML sitemap.'=>'この分類法の用語のアーカイブページをXMLサイトマップに含めます。 ','Include Empty Terms'=>'空の単語を含める','Include archive pages of terms that have no posts associated.'=>'投稿が関連付けられていない用語のアーカイブページを含めます。','Product\'s price.'=>'商品の価格','Product\'s price of the current product'=>'現在の製品の製品の価格','Product\'s SKU.'=>'商品 SKU','Product\'s SKU of the current product'=>'現在の製品の SKU','Product\'s short description.'=>'製品の簡単な説明。','Product\'s short description of the current product'=>'現在の製品の簡単な説明','Product\'s brand.'=>'製品のブランド。','Product\'s brand of the current product'=>'現在の製品の製品のブランド','Remove base'=>'ベースを取り外します','Remove category base'=>'カテゴリーベースを削除','Remove prefix from category URL.'=>'カテゴリURLからプレフィックスを削除します。','default: /product-category/accessories/action-figures/ - changed: /accessories/action-figures/'=>'デフォルト：/product-category/accessories/action-figures/ - かわった：/accessories/action-figures/',' Remove parent slugs'=>'親スラッグを削除します','Remove parent slugs from category URL.'=>'カテゴリーURLから親スラッグを削除します。','default: /product-category/accessories/action-figures/ - changed: /product-category/action-figures/'=>'デフォルト：/product-category/accessories/action-figures/ - かわった：/product-category/action-figures/','Remove Generator Tag'=>'ジェネレータのタグを削除する','Remove WooCommerce generator tag from the source code.'=>'ソースコードから WooCommerce ジェネレータータグを削除します。','Enable breadcrumbs function'=>'パンくずリストの機能を有効にする','Turning off breadcrumbs will hide breadcrumbs inserted in template files too.'=>'パンくずリストをオフにすると、テンプレートファイルに挿入されたブレッドクラムも非表示になります。','Separator character or string that appears between breadcrumb items.'=>'パンくずリスト項目の間に表示される区切り文字または文字列。','Show Homepage Link'=>'ホームページのリンクを表示','Display homepage breadcrumb in trail.'=>'ホームページのパンくずリストをトレイルに表示します。','Homepage label'=>'ホームページのラベル','Label used for homepage link