を、それらが表示される投稿にリダイレクトします。より高度なリダイレクト制御については、組み込みの%sを使用してください。','Redirect attachments without a parent post to this URL. Leave empty for no redirection.'=>'親投稿のない添付ファイルをこのURLにリダイレクトします。 リダイレクトしない場合は空のままにします。','Nofollow Domains'=>'Nofollowのドメイン','Only add <code>nofollow</code> attribute for the link if target domain is in this list. Add one per line. Leave empty to apply nofollow for <strong>ALL</strong> external domains.'=>'ターゲットドメインがこのリストにある場合にのみ、リンクに<code>nofollow</code>属性を追加します。 1行に1つずつ追加します。 <strong>すべて</strong>の外部ドメインにnofollowを適用するには、空のままにします。','Nofollow Exclude Domains'=>'nofollow から除外されたドメイン','The <code>nofollow</code> attribute <strong>will not be added</strong> for the link if target domain is in this list. Add one per line.'=>'ターゲットドメインがこのリストにある場合、リンクの<code>nofollow</code>属性は<strong>追加されません</strong>。 1行に1つずつ追加します。 ','Automatically add <code>target="_blank"</code> attribute for external links appearing in your posts, pages, and other post types to make them open in a new browser tab or window. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'投稿、ページ、その他の投稿タイプに表示される外部リンクの<code>target="_blank"</code>属性を自動的に追加して、新しいブラウザのタブまたはウィンドウで開くようにします。 この属性は、コンテンツが表示されるときに動的に適用され、保存されているコンテンツは変更されません。 ','RSS Before Content'=>'コンテンツの前の RSS','Add content before each post in your site feeds.'=>'サイトフィードの各投稿の前にコンテンツを追加します。','RSS After Content'=>'コンテンツ後の RSS','Add content after each post in your site feeds.'=>'サイトフィードの各投稿の後にコンテンツを追加します。','Contents are locked because a robots.txt file is present in the root folder.'=>'ルートフォルダにrobots.txtファイルが存在するため、コンテンツはロックされています。','A link to the archive for the post author, with the authors name as anchor text.'=>'投稿者名のアンカーテキスト付きの投稿者のアーカイブへのリンクです。','A link to the post, with the title as anchor text.'=>'タイトルのアンカーテキスト付きの投稿へのリンクです。','A link to your site, with your site\'s name as anchor text.'=>'サイト名のアンカーテキスト付きのサイトへのリンクです。','A link to your site, with your site\'s name and description as anchor text.'=>'サイト名と説明文のアンカーテキスト付きのサイトへのリンクです。','Featured image of the article.'=>'投稿のアイキャッチ画像。','Google Search Console'=>'Google Search Console','Search Console Verification Page'=>'Search Console の確認ページ','Bing Webmaster Tools'=>'Bing Webmaster Tools','Enter your Bing Webmaster Tools verification HTML code or ID. Get it here: %s'=>'Bing Webmaster Tools の確認用のHTMLコードまたはIDを入力します。 ここから入手してください：%s','Bing Webmaster Verification Page'=>'Bing Webmaster の確認ページ','Yandex Verification ID'=>'Yandex 確認ID','Yandex.Webmaster Page'=>'Yandex のウェブマスターページ','Pinterest Verification ID'=>'Pinterest の確認 ID','Pinterest Account'=>'Pinterest アカウント','Norton Safe Web Verification ID'=>'Norton Safe Web 検証ID','Norton Ownership Verification Page'=>'Norton 所有権確認ページ','Author Archives'=>'投稿者アーカイブ','Author Base'=>'投稿者ベース','Change the <code>/author/</code> part in author archive URLs.'=>'投稿者アーカイブURLの<code>/author/</code>部分を変更します。','Author Archive Title'=>'投稿者アーカイブタイトル','Title tag on author archives. SEO options for specific authors can be set with the meta box available in the user profiles.'=>'投稿者アーカイブのタイトルタグ。 特定の投稿者のSEOオプションは、ユーザープロファイルで使用可能なメタボックスを使用して設定できます。','Author Archive Description'=>'投稿者アーカイブの説明','Author archive meta description. SEO options for specific author archives can be set with the meta box in the user profiles.'=>'投稿者アーカイブのメタ記述。 特定の投稿者アーカイブのSEOオプションは、ユーザープロファイルのメタボックスで設定できます。','Add SEO Controls for user profile pages. Access to the Meta Box can be fine tuned with code, using a special filter hook.'=>'ユーザープロファイルページのSEOコントロールを追加します。 メタボックスへのアクセスは、特別なフィルターフックを使用してコードで微調整できます。','Default values for robots meta tag. These can be changed for individual posts, taxonomies, etc.'=>'robots メタタグのデフォルト値。 これらは、個々の投稿、タクソノミーなどに合わせて変更できます。','You can use the separator character in titles by inserting <code>%separator%</code> or <code>%sep%</code> in the title fields.'=>'タイトルフィールドに<code>%separator%</code>または<code>%sep%</code>を挿入すると、タイトルに区切り文字を使用できます。','Capitalize Titles'=>'タイトルを大文字にする','Twitter Card Type'=>'Twitter カードの種類','Card type selected when creating a new post. This will also be applied for posts without a card type selected.'=>'新しい投稿を作成するときに選択したカードの種類。 これは、カードタイプが選択されていない投稿にも適用されます。','Homepage title tag.'=>'ホームページのタイトルタグ。','Homepage Meta Description'=>'ホームページメタの説明','Homepage meta description.'=>'ホームページメタの説明','Homepage Robots Meta'=>'ホームページrobotsメタ','Select custom robots meta for homepage, such as <code>nofollow</code>, <code>noarchive</code>, etc. Otherwise the default meta will be used, as set in the Global Meta tab.'=>'<code>nofollow</code>、<code>noarchive</code>など、ホームページのカスタムロボットメタを選択します。それ以外の場合は、「グローバルメタ」タブで設定されているデフォルトのメタが使用されます。','Custom values for robots meta tag on homepage.'=>'ホームページのrobotsメタタグのカスタム値。','Homepage Title for Facebook'=>'Facebook のホームページタイトル','Title of your site when shared on Facebook, Twitter and other social networks.'=>'Facebook、Twitter、その他のソーシャルネットワークで共有されたときのサイトのタイトル。','Homepage Description for Facebook'=>'Facebook のホームページの説明','Description of your site when shared on Facebook, Twitter and other social networks.'=>'Facebook、Twitter、その他のソーシャルネットワークで共有されたときのサイトの説明。','Homepage Thumbnail for Facebook'=>'Facebook のホームページサムネイル','Image displayed when your homepage is shared on Facebook and other social networks. Use images that are at least 1200 x 630 pixels for the best display on high resolution devices.'=>'Facebook やその他のソーシャルネットワークでホームページを共有するときに表示される画像。 高解像度デバイスで最高のディスプレイを得るには、1200x630 ピクセル以上の画像を使用してください。','Date Archives'=>'日付アーカイブ','Date Archive Title'=>'日付アーカイブタイトル','Title tag on day/month/year based archives.'=>'日/月/年ベースのアーカイブのタイトルタグ。','Date Archive Description'=>'日付アーカイブの説明','Date archive description.'=>'日付アーカイブの説明','Search Results Title'=>'検索結果のタイトル','Title tag on search results page.'=>'検索結果ページのタイトルタグ。','404 Title'=>'404タイトル','Title tag on 404 Not Found error page.'=>'404 Not Foundエラーページのタイトルタグ。','Response Code'=>'レスポンスコード','Items'=>'項目','Update data manually'=>'データを手動で更新する','Rank Math is compatible with your PHP version but w